import{_ as a,c as e,o as t,V as o}from"./chunks/framework.249fa23d.js";const u=JSON.parse('{"title":"PDF图像插件","description":"","frontmatter":{},"headers":[],"relativePath":"zh/guide/Plugin_Image_PDF.md","filePath":"zh/guide/Plugin_Image_PDF.md","lastUpdated":1706778247000}'),s={name:"zh/guide/Plugin_Image_PDF.md"},i=o('<h1 id="pdf图像插件" tabindex="-1">PDF图像插件 <a class="header-anchor" href="#pdf图像插件" aria-label="Permalink to &quot;PDF图像插件&quot;">​</a></h1><p>墨干的渲染器无法支持PDF图像，通常此类PDF图像是PDF矢量图，由第三方软件制作（比如在Octave或者Maxima导出为PDF矢量图）。</p><p>墨干在渲染PDF图像时，需要依赖于Ghostscipt将PDF图像转换为PNG图像。故而该插件需要用户手动安装Ghostscript。</p><h2 id="如何安装ghostscript" tabindex="-1">如何安装Ghostscript <a class="header-anchor" href="#如何安装ghostscript" aria-label="Permalink to &quot;如何安装Ghostscript&quot;">​</a></h2><h3 id="windows" tabindex="-1">Windows <a class="header-anchor" href="#windows" aria-label="Permalink to &quot;Windows&quot;">​</a></h3><p>前往<a href="https://www.ghostscript.com" target="_blank" rel="noreferrer">Ghostscript官网</a>下载安装包并按照默认路径安装到系统C盘。</p><p>如果用户没有按照默认路径安装，则需要手动将<code>gs.exe</code>所在目录添加到PATH中。</p><h3 id="macos" tabindex="-1">macOS <a class="header-anchor" href="#macos" aria-label="Permalink to &quot;macOS&quot;">​</a></h3><p>使用<code>brew install ghostscript</code>安装。</p><h3 id="linux" tabindex="-1">Linux <a class="header-anchor" href="#linux" aria-label="Permalink to &quot;Linux&quot;">​</a></h3><p>使用<code>sudo apt install ghostscript</code>等方式安装。</p>',11),r=[i];function c(n,d,h,l,p,_){return t(),e("div",null,r)}const m=a(s,[["render",c]]);export{u as __pageData,m as default};
